		function UpdateTime(x, time, duration) {
			if(v.delete > 0) {
				time -= v.delete;
				duration -= v.delete
			}
			var y = Time(time);
			if(x.s("inversetime") == "1") {
				y = Time(duration - time)
			}
			if(x.s("showduration") == "1") {
				if(x.s("showboth") == "1") {
					y = y + (duration > 0 ? ' ' + Lang(x.s("separator")) + ' ' + Time(duration) : '')
				} else {
					time == 0 ? y = Time(duration) : ''
				}
			}
			x.UpdateText(y)
		}
